import React, { useState } from 'react'
import { NavLink } from 'react-router-dom'

const Sidebar = () => {
  const [responsive,setresponsive] = useState(false)
  return (
    <div>
      <nav className="navbar">
        <img src="./images/image1.png" alt='logo' className='logo' />
      
          <ul className={ responsive ? "nav_links_responsive" :"navbar_links "}
          onClick={() => setresponsive(false)}>
            <NavLink to="/"><li>Dashboard</li></NavLink>
            <NavLink to="/whatwedo" ><li>use Profile</li></NavLink>
            <NavLink to="/corporate" ><li>Table List</li></NavLink>
            <NavLink to="/login" ><li>Log info</li></NavLink>
          </ul>
          <button className='mobile_menu_icon'
          onClick={()=> setresponsive(!responsive)}>
            { responsive ? (
              <i className='fas fa-times'></i>
              ) : (
              <i className='fas fa-bars'></i>
            )}
          </button>
        </nav>
      </div>
  )
}

export default Sidebar
